"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[3184],{4189:e=>{e.exports=JSON.parse('{"tag":{"label":"ctf_18.2","permalink":"/docs/tags/ctf-18-2","allTagsPath":"/docs/tags","count":11,"items":[{"id":"BaselinePages/compare-baselines","title":"Compare Baselines and Baseline Definitions","description":"You can compare two Baselines created at two different points in time to know the differences. You can also compare the Baseline Definitions of two Baselines.","permalink":"/docs/BaselinePages/compare-baselines"},{"id":"BaselinePages/create-baseline","title":"Create and View Baselines","description":"Create a Baseline when you accomplish specific milestones in your project or when you release or deliver a product. You can create a Baseline from either a Baseline Definition or from the ground up.","permalink":"/docs/BaselinePages/create-baseline"},{"id":"BaselinePages/create-baseline-def","title":"Create, View, and Delete Baseline Definitions","description":"A Baseline Definition is the filter criteria that is used to create a Baseline from a set of selected configuration items such as Tracker Artifacts, Documents, Source Code Repositories (only Git and Subversion are supported), File Releases, and Binaries (only Nexus binaries are supported) in a given TeamForge project.","permalink":"/docs/BaselinePages/create-baseline-def"},{"id":"IntegrationPages/installnexus","title":"Install Nexus","description":"TeamForge supports only Nexus 3 integration. This page walks you through the installation procedure for Nexus 3 and upgrade procedure from Nexus 2 to Nexus 3.","permalink":"/docs/IntegrationPages/installnexus"},{"id":"linkifycustomobjectids","title":"Linkify Custom Object IDs in Code Browser","description":"Include custom object IDs in your commit messages and have them automatically converted to hyperlinks. This is possible if you set up custom object ID mapping for the repository.","permalink":"/docs/linkifycustomobjectids"},{"id":"scripts/logger-db-query","title":"logger-db-query","description":"Use the logger-db-query script to enable or disable logging for queries.","permalink":"/docs/scripts/logger-db-query"},{"id":"BaselinePages/baseline-review-approval-workflow","title":"Review Baselines","description":"A Baseline or a Project Baseline, once created can be reviewed. During the review cycle, the Baseline or the Project Baseline undergoes various status transitions as defined by the Baseline Administrator.","permalink":"/docs/BaselinePages/baseline-review-approval-workflow"},{"id":"BaselinePages/search-baseline","title":"Search Baselines and Baseline Definitions","description":"You can search for the existing Baselines, Project Baselines and Baseline Definitions based on all stored attributes.","permalink":"/docs/BaselinePages/search-baseline"},{"id":"release-notes/siteoptionschangelog","title":"Site Options Change Log","description":"Change log of site-options.conf tokens.","permalink":"/docs/release-notes/siteoptionschangelog"},{"id":"BaselinePages/baseline-overview","title":"TeamForge Baseline - An Overview","description":"What is a Baseline Definition?","permalink":"/docs/BaselinePages/baseline-overview"},{"id":"IntegrationPages/managebinaries","title":"TeamForge Binary Integration Overview","description":"An important aspect of the end-to-end development lifecycle is the creation and storage of software packages that are often binary artifacts. In the Java world, these are usually reusable jars that are used by other projects. Binary artifact repository managers are software systems that manage, version, and store binary artifacts. Example of such repository manager is Sonatype Nexus.","permalink":"/docs/IntegrationPages/managebinaries"}],"unlisted":false}}')}}]);